const initialState = {
    userAthantication: false,
    AccessToken: null,
};

export function Reducer1(state = initialState, action){
    switch(action.type){
        case "ATHANTICATION": 
            return {...state, userAthantication: action.payload.no ,AccessToken: action.payload.AccessToken };
        default:
            return state;
    }
}
export default Reducer1;
